       //     .catch(e => console.log(e))
   // }, [])
   // console.log(lastUser)

    return (
        <div className="col-lg-6 mb-4">
            <div className="card shadow mb-4">
                <div className="card-header py-3">
                    <h5 className="m-0 font-weight-bold text-gray-800">Último usuario registrado</h5>
                </div>
                <div className="card-body">
                    <div className="text-center">
                        <img className="img-fluid px-3 px-sm-4 mt-3 mb-4" style={{ width: 14 + 'rem' }} src={ultimoId.imagen} alt="imágen del usuario" />
                        <p>ID: {ultimoId.id}</p>
                        <p>Nombre: {ultimoId.nombre}</p>
                        <p>Apellido: {ultimoId.apellido}</p>
                        <p>Domicilio: {ultimoId.domicilio}</p>
                        <p>Telefono: {ultimoId.telefono}</p>
                        <p>Email: {ultimoId.email}</p>
                    </div>

                    {/*<!-- Content Row Movies-->  <a className="btn btn-danger" target="_blank" rel="nofollow" href="/">View movie detail</a>*/}
                </div>
            </div>
        </div>
    )
}

export default LastUserInDb;
